import React, {Component} from 'react';
import './index.css';
import WeatherCard from './WeatherCard';
import TextField from '@material-ui/core/TextField';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Search from './Search';

export default class DisplayWeather extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cities: ['Харьков', 'Киев', 'Одесса', 'Львов'],
    };
  }

  Add() {
    this.setState({cities: ['Харьков', 'Киев', 'Одесса', 'Львов', 'London']})
  }

  render() {
    return (
      <div>
      <Box
        display="flex"
        flexWrap="wrap"
        justifyContent="space-between"
        padding="5%">

        {this.state.cities.map((value, index) => {
        return <WeatherCard key = {index} name={value} />
        })}

        <Button
          variant="contained"
          color="primary"
          size="large"
          onClick={() => alert(this.Add)}
          >Добавить
        </Button>
      </Box>
        <Search />
      </div>
    );
  }
}
